const subNav = (
    <div class="navbar-nav text-secondary">
            <a className="nav-item nav-link active" href="#">about</a>
            <a className="nav-item nav-link" href="#">Work</a>
            <a className="nav-item nav-link" href="#">Contant</a>
    </div>
);

const SubNav = () =>{
    return subNav;
}



const nav = (
<nav className="navbar navbar-expand-md navbar-dark bg-dark">
    <a className="navbar-brand text-primary" href="#">BootStrap Tutorial
</a>
    <SubNav />
</nav>);


const Nav = () => {
    return nav;
}
export default Nav;
